import React from 'react';
import { Navbar, Pastpaperbox } from '../components';
import { Button, Dropdown } from 'flowbite-react';
import bio from '../assets/biology.avif'
import lit from '../assets/literature.jpeg'
import hist from '../assets/history.jpeg'
import phys from '../assets/physics.jpeg'
import rel from '../assets/religion.jpeg'
import eng from '../assets/english.png'
import chem from '../assets/chemistry.avif'
import com from '../assets/commerce.jpeg'
import geo from '../assets/geography.jpeg'
import math from '../assets/math.webp'
import acc from '../assets/accounting.jpeg'

const PastPapers = () => {
  return (
    <div className="">
      <Navbar />
      <div className="flex flex-col px-[5%] w-[100%]">
        <div className="mt-[5%] pb-10 font-extralight text-white xl:text-6xl">
          <p >View Past Papers</p>
        </div>

        <div className="flex items-center text-white font-poppins w-[100%]">
            {/* !!!!!!!!!!!  BIOLOGY  !!!!!!!!!!!!!!!*/}
            <div className="w-[50%] flex grid grid-cols-4 py-5">
                <Pastpaperbox title_subj="2023" img_subj={bio}/>

              {/* !!!!!!!!!!!  PHYSICS  !!!!!!!!!!!!!!!*/}
                <Pastpaperbox title_subj="2022" img_subj={phys}/>

              {/* !!!!!!!!!!!  History  !!!!!!!!!!!!!!!*/}
                <Pastpaperbox title_subj="2021" img_subj={hist}/>


              {/* !!!!!!!!!!!  CHEM  !!!!!!!!!!!!!!!*/}
                <Pastpaperbox title_subj="2020" img_subj={chem}/>

              {/* !!!!!!!!!!!  Literature  !!!!!!!!!!!!!!!*/}  
                <Pastpaperbox title_subj="2019" img_subj={lit}/>

              {/* !!!!!!!!!!!  Religion  !!!!!!!!!!!!!!!*/}
                <Pastpaperbox title_subj="2018" img_subj={rel}/>

              {/* !!!!!!!!!!!  Commerce  !!!!!!!!!!!!!!!*/}
                <Pastpaperbox title_subj="2017" img_subj={com}/>

              {/* !!!!!!!!!!!  Geography  !!!!!!!!!!!!!!!*/}
                <Pastpaperbox title_subj="2016" img_subj={geo}/>

              {/* !!!!!!!!!!!  English  !!!!!!!!!!!!!!!*/}
                <Pastpaperbox title_subj="2015" img_subj={eng}/>

              {/* !!!!!!!!!!!  Mathematics  !!!!!!!!!!!!!!!*/}
                <Pastpaperbox title_subj="2014" img_subj={math}/>

              {/* !!!!!!!!!!!  Bookkeeping & Accounts  !!!!!!!!!!!!!!!*/}
                <Pastpaperbox title_subj="2013" img_subj={acc}/>

            </div>
            <div className="w-50%]">
              <h1> View By Subject </h1>
            </div>

        </div>
        </div>
</div>
  );
};

export default PastPapers;
